import newTweet from './newTweet'
import testTweet from './testTweet'

var tweetArray = [newTweet, testTweet, testTweet, newTweet, newTweet, testTweet, testTweet, newTweet];

var testFetch = fetch('http://localhost:9200/index_name/_search?q=text:draft&size=10000', {
  mode: 'no-cors'
  })
    .then(function(response) {
      return response.json();
    })
    .then(function(myJson) {
      console.log(JSON.stringify(myJson));
