            </a>
          </header>
        </div> */
        <div className="App-header">
          <div className="search-bar">
            {input = <Input icon='search' iconPosition="left" placeholder='Search...' />}
          </div>
          {/* <Test tweets={tweetArray}/> */}
          <div className="center-tweets">
            <Card.Group itemsPerRow={2}>
              {items}
            </Card.Group>
          </div>
        </div>
    );
  }
}

export default App;
